data: {"answer": "**Bill Share** refers to the proportion of short-term Treasury bills (T-bills) in total Treasury issuance. It is significant because T-bills are often purchased by money market funds with excess cash, making them less draining on overall liquidity compared to long-term coupon bonds. A higher share of bills in total issuance indicates less of a headwind for markets.\n\n- **Calculation**: It is derived from the series `UST_AUCTION_OFFERINGS`, which sums bills versus coupons by auction date.\n- **Directionality**: A higher bill share is considered supportive for liquidity.\n- **Scoring Threshold**: A bill share of 65% or more is seen as less draining on liquidity.\n\nIn summary, bill share helps assess the liquidity impact of Treasury issuance, with a higher percentage of bills being more favorable for market conditions.", "tool_trace": [{"tool": "get_doc", "args": {"id": "bill_share"}, "result": "- **Why it matters**: Not all issuance is created equal. Short-term T-bills are often bought by money market funds with excess cash, so they are less draining on overall liquidity than long-term coupon bonds, which require duration-taking investors to sell other assets to make room. A higher share of bills in total issuance is therefore less of a headwind for markets.\n  - **Series chosen**: `UST_AUCTION_OFFERINGS` (sum of bills vs coupons by auction date) to calculate the proportion of bills in issuance.\n  - **Status**: Ingested (`UST_AUCTION_OFFERINGS`); bill-only variant stored as `UST_BILL_OFFERINGS`.\n  - Directionality: `higher_is_supportive`\n  - Scoring: `threshold`; Trigger: `>= 65% => less drain`\n  - Bucket: `duplicates_of: ust_net_2w`"}]}

